const Header = () => {
  return (
    <nav>
      <img
        src="https://res.cloudinary.com/dzscdp79g/image/upload/v1690657588/home_2_zebsfl.png"
        alt="home"
      />
      <div>
        <h1>Rahul</h1>
        <img
          src="https://res.cloudinary.com/dzscdp79g/image/upload/v1690736126/Group_848_jncvqw.png"
          alt="logout"
        />
      </div>
    </nav>
  );
};
export default Header;
